import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

// Mounting the App component to the root DOM element
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root") // Ensure this matches the ID in your HTML file
);
